import * as React from 'react';
import { View, Button } from 'react-native';
import { BottomNavigation, Text } from 'react-native-paper';


const pr=(screen,jump)=>{
    jump(screen);
}
const MusicRoute = (props) => <Text>Music{props.text}</Text>;

const AlbumsRoute = (props) => <Text>Albumshii<Button onPress={pr('profile',props.jump)} title='hii' /></Text>;

const RecentsRoute = () => <Text>Recents</Text>;

const Navbar = () => {
    const [loggedIn,setLogin]=React.useState(true);
  const [index, setIndex] = React.useState(0);
  var [routes] = React.useState([

    { key: 'home', title: 'Home', icon: 'home' },
    { key: 'issue', title: 'Issue', icon: 'plus' },
    { key: 'profile', title: 'Profile', icon: 'user' }

  ]);
  if(!loggedIn){
      [routes] = React.useState([
    { key: 'music', title: 'Music', icon: 'queue-music' },
    { key: 'albums', title: 'Albums', icon: 'album' }

      ]);
  }


  const rendersc=({route,jumpTo})=>{
      switch (route.key){
          case 'home':
              return <MusicRoute jump={jumpTo} text='hii'/>;
            case 'issue':
                return <AlbumsRoute jump={jumpTo} set={setIndex}/>;
                case 'profile':
                    return <RecentsRoute />

      }
  }
  const renderScene = BottomNavigation.SceneMap({
    home: MusicRoute,
    issue: AlbumsRoute,
    recents: RecentsRoute,
  });

  return (
    <BottomNavigation
      navigationState={{ index, routes }}
      onIndexChange={setIndex}
      renderScene={rendersc}
    />
  );
};

export default Navbar;
